const Footer = () => {
  return (
    <footer className="bg-gray-800 text-white text-center py-6 mt-16">
      <p className="text-sm">&copy; 2025 Saint Francis Reunion. All rights reserved.</p>
      <div className="mt-2 space-x-4 text-sm">
        <a href="tel:+639493540311" className="hover:underline">
          Call Us
        </a>
        <span>|</span>
        <a href="mailto:meg2dud@yahoo.com" className="hover:underline">
          Contact Us
        </a>
      </div>
    </footer>
  );
};

export default Footer;
